  "41": {"#ru": "Добро пожаловать в мир нерушимых контрактов. Это двусторонние эскроу-контракты (двойной депозит), которые нельзя нарушить и не требуют арбитров от третьих лиц. Оба пользователи размещают настраиваемый депозит вместе с оплатой на общий счет. Если сделка проходит успешно, они оба ее подтверждают. Если одна из сторон пытается обмануть другую, сделка в конечном итоге истекает и разрушается, так что никто не выигрывает, и кража становится бесполезной. Это заставляет пользователей быть честными и соблюдать свои соглашения, поскольку они либо выигрывают вместе, либо проигрывают вместе."},
  "42": {"#ru": "Сами рынки работают на блокчейнах Solidity, таких как Ethereum и Polygon. Предложения могут варьироваться от товаров, услуг, бартера до P2P-торговли. Поскольку эта веб-страница полностью открытого исходного кода и работает на стороне клиента, пользователь также может загрузить этот код с GitHub и запустить его локально для еще большей безопасности. Этот протокол, который был создан BitHalo еще в 2014 году, предшествовал Ethereum и был первым в мире смарт-контрактом. Это веб-интерфейс для полностью децентрализованных рынков."},
  "43": {"#ru": "Для продажи товаров пользователи определенно захотят рассмотреть возможность прямой доставки или услуги, которая обеспечивает доставку со скидкой, чтобы конкурировать со тарифами на доставку, обычно встречающимися в крупных компаниях. Для этого вам следует зарегистрировать стороннюю учетную запись доставки, которая в некоторых случаях позволит вам сэкономить до 75% на доставке. Продавцы также могут взимать с покупателей плату за доставку, пока она находится на условном депонировании, и покупатели должны быть осторожны, чтобы убедиться, что сумма не превышает депозит, или что они сами покупают транспортную этикетку. Пользователям следует стараться поддерживать связь друг с другом в процессе условного депонирования, и рекомендуется иметь резервную копию ваших ключей, чтобы обе стороны были защищены во время депонирования. Хотя эти рынки могут модерироваться с помощью искусственного интеллекта (например, webgpt) и модерации, управляемой сообществом, пользователи несут полную ответственность за риски того, что они публикуют, и за свои собственные депозиты. Имея это в виду, настоятельно рекомендуется не публиковать контент, который является незаконным в стране вашего проживания. Для сделок, в которых используются наличные, пользователи должны провести собственную комплексную проверку и, при необходимости, «знать своего клиента». В интересах каждого использовать двойное условное депонирование, чтобы избавиться от обмана в мире международной торговли и услуг. Это преимущество, когда пользователи сами администрируют контракты, поскольку арбитры не могут знать правду о несправедливом решении сделки и могут вступить в сговор, что приведет к большим потерям, а также повлечет за собой более высокие затраты. Пользователи вынуждены работать друг с другом для достижения желаемого результата. Пользователи также размещают предложения с использованием IPFS. Поэтому хорошей практикой является запуск собственного узла IPFS для архивирования рынков. Рекомендуется зарегистрировать свою контактную информацию в блокчейне. Это дает гарантию того, что контрагенты по договору знают, как с вами связаться по любым вопросам, связанным с переговорами. Код можно запускать локально, а также его можно проверить, посетив страницу github, где размещен код и веб-сайт. Эта система не имеет владельца и полностью бесплатна для использования. Однако есть настройка, которую можно активировать для партнеров/рефералов, которая может варьироваться от 0 до 1%. Чтобы побудить пользователей взаимодействовать с партнерами, комиссия сгорает, если она не выплачивается партнеру. Это помогает продвигать систему, предоставляя пользователям возможность зарабатывать. Пользователь рынков автоматически становится партнером, если он совершает 10 сделок. Это позволяет им использовать рынки бесплатно, если они захотят (поскольку они могут быть собственными партнерами), а также отправлять пользователей на веб-сайт через партнерскую ссылку. Посещение ссылки регистрирует партнера в этой учетной записи, когда сделка принята, и позволяет ему получать выгоду от этого реферала. Кроме того, некоторые продавцы могут предлагать более привлекательную комиссию за рефералов, которая должна позволить партнерам получать больше прибыли по взаимному согласию. Для получения дополнительной информации о том, как работает BitBay, вы можете посетить: "},
